'use client';

import React from 'react';
import styles from './EmptyState.module.css';

interface EmptyStateProps {
  /** Icon type: 'notification', 'wishlist', or 'search' - uses SVG from public folder */
  iconType?: 'notification' | 'wishlist' | 'search';
  /** Custom React element to render as icon (overrides iconType) */
  customIcon?: React.ReactNode;
  title: string;
  description: string;
  buttonText?: string;
  onButtonClick?: () => void;
}

/**
 * EmptyState Component - Displays empty state with icon and message
 * Features: Built-in SVG icons for notifications, wishlist, and search
 * Can accept custom icon element
 */
export const EmptyState: React.FC<EmptyStateProps> = ({
  iconType = 'notification',
  customIcon,
  title,
  description,
  buttonText,
  onButtonClick,
}) => {
  // Render custom icon if provided
  if (customIcon) {
    return (
      <div className={styles.container}>
        <div className={styles.content}>
          <div className={styles.iconContainer}>{customIcon}</div>
          <h2 className={styles.title}>{title}</h2>
          <p className={styles.description}>{description}</p>
        </div>
        {buttonText && (
          <button className={styles.button} onClick={onButtonClick}>
            {buttonText}
          </button>
        )}
      </div>
    );
  }

  // Default SVG icons
  const renderIcon = () => {
    switch (iconType) {
      case 'notification':
        return (
          <svg width="195" height="230" viewBox="0 0 195 230" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
        <rect width="194.45" height="230" fill="url(#pattern0_1736_7063)"/>
        <defs>
        <pattern id="pattern0_1736_7063" patternContentUnits="objectBoundingBox" width="1" height="1">
        <use xlinkHref="#image0_1736_7063" transform="matrix(0.00277008 0 0 0.00234192 -0.955679 -0.510539)"/>
        </pattern>
        <image id="image0_1736_7063" width="1024" height="962" preserveAspectRatio="none" xlinkHref="data:image/png;base64,"/>
        </defs>
        </svg>
        );
      case 'wishlist':
        return (
          <svg width="294" height="231" viewBox="0 0 294 231" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
          <rect width="293.25" height="230.369" fill="url(#pattern0_1736_7077)"/>
          <defs>
          <pattern id="pattern0_1736_7077" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlinkHref="#image0_1736_7077" transform="matrix(0.00200401 0 0 0.00255102 -0.567134 -0.556122)"/>
          </pattern>
          <image id="image0_1736_7077" width="1024" height="962" preserveAspectRatio="none" xlinkHref="data:image/png;base64,"/>
          </defs>
          </svg>
        );
      case 'search':
      default:
        return (
          <svg
            className={styles.icon}
            viewBox="0 0 24 24"
            fill="none"
            stroke="currentColor"
            strokeWidth="2"
          >
            <circle cx="11" cy="11" r="8" />
            <path d="m21 21-4.35-4.35" />
          </svg>
        );
    }
  };

  return (
    <div className={styles.container}>
      <div className={styles.content}>
        <div className={styles.iconContainer}>{renderIcon()}</div>
        <h2 className={styles.title}>{title}</h2>
        <p className={styles.description}>{description}</p>
      </div>
      {buttonText && (
        <button className={styles.button} onClick={onButtonClick}>
          {buttonText}
        </button>
      )}
    </div>
  );
};

export default EmptyState;